const tags = ["mediterranean", "italian", "european", "greek", "chinese,", "asian", "cajun", "creole", "american"]


const shuffleTags = (tags) => {
    const newArr = []
    const sortTags = tags.sort(() => Math.random() - 0.5)
    newArr.push(sortTags)
    return newArr.shift()
}

const ourRandomTags = shuffleTags(tags)

export default ourRandomTags
